import React from 'react';
import AdminNav from '../../components/nav/AdminNav';

const AdminDashboard = () => {

    return (
        <div>
            <div>
                <span>
                    <Search />
                </span>
            </div>
            <div className='container-fluid'>
                <div className="row">

                    <div className="col-md-2">
                        <AdminNav />
                    </div>

                    <div className="col" >
                        <h4>Admin Dashboard</h4>

                    </div>
                </div>
            </div>
        </div>
    );
};

export default AdminDashboard;
